import React from 'react';
import logo from './logo.svg';
import './App.css';
import WelcomeClass from './jsx/WelcomClass';
import Welcome from './jsx/Welcome';
import Clock from './jsx/Clock';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <WelcomeClass name="Guru Sri Raghvendra" />
        <Welcome name="Guru Sri Raghvendra"/>
        <Clock />
      </header>
    </div>
  );
}

export default App;
